import CartAmount from "./CartAmount";
import wishlistIcon from "../Assets/wishlist.svg";

const Cart = () => {
return (
<div>
    <div>
    <button>Warenkorb</button>
    </div>
    <CartAmount />
    <div>
    {wishlistIcon} Auf den Wunschzettel
    </div>
</div>
);

}

export default Cart;
